CREATE DEFINER=`root`@`localhost` PROCEDURE `proc_dev_track`(
   IN p_dev_id       varchar(45),
   IN p_track_type   varchar(20),
   IN p_dml          varchar(20))
BEGIN
   IF (p_dml = 'insert') THEN
      INSERT INTO `asc`.dev_tracker(dev_id, track_type, track_status)
         SELECT p_dev_id, p_track_type, 1
           FROM dual
          WHERE NOT EXISTS
                   (SELECT *
                      FROM `asc`.dev_tracker d
                     WHERE     d.dev_id = p_dev_id
                           AND d.track_type = p_track_type
                           AND d.track_status = 1);
   ELSEIF (p_dml = 'delete') THEN
      UPDATE `asc`.dev_tracker d
         SET track_status = -1
       WHERE     d.dev_id = p_dev_id
             AND d.track_type = p_track_type
             AND d.track_status = 1;                           

   END IF;   
END ;;
